import React from 'react';
import icon from '../icons/home_icon_25x25.svg';
import './Footer.css';


function Footer() {

    return (
        <div>
            <ul className="footer__listitems">
            <li><img src={icon} width="50" height="50" alt="Homeicon" /></li>
            <li><img src={icon} width="50" height="50" alt="Exploreicon" /></li>
            <li><img src={icon} width="50" height="50" alt="Treasureicon" /></li>
            <li><img src={icon} width="50" height="50" alt="Profileicon" /></li>
            </ul>
        </div>
    )
}

export default Footer;
